likes.fullText:
Future CSS Tip! 🔮

Scroll-linked animation powered by CSS 🤯

header { view-timeline-name: --head; }
.avatar{
  animation: size;
  animation-timeline: --head;
  animation-time-range: exit 0% 50%;
}
@ keyframes size {to{scale: 0.3;}}

See the changes? 🧐

Demo link/info below! 👇 https://t.co/1nmtdec1G2

